// ===========================================================================================================
// PulseHER App.js - Web React Version with PPG Integration
// ===========================================================================================================
// PulseHER: Heart Health App for Women
// Written by Yuna (originally based on AI-generated scaffold, fully rewritten and tested)


import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import WelcomeScreen from "./pages/WelcomeScreen";
import HomeScreen from "./pages/HomeScreen";
import PulseScanScreen from "./pages/PulseScanScreen";
import InsightScreen from "./pages/InsightScreen";
import EducationScreen from "./pages/EducationScreen";
import ProfileScreen from "./pages/ProfileScreen";
import Navbar from "./components/Navbar";

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<WelcomeScreen />} />
        <Route path="/home" element={<HomeScreen />} />
        <Route path="/scan" element={<PulseScanScreen />} />
        <Route path="/insights" element={<InsightScreen />} />
        <Route path="/learn" element={<EducationScreen />} />
        <Route path="/profile" element={<ProfileScreen />} />
      </Routes>
    </Router>
  );
}

export default App;
